// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract RealEstate is Ownable {
    struct Property {
        string name;
        string location;
        uint256 totalValue;
        uint256 totalShares;
        uint256 availableShares;
        uint256 pricePerShare;
        address owner;
        bool isListed;
    }

    struct Review {
        address reviewer;
        uint8 rating;
        string comment;
        uint256 timestamp;
    }

    mapping(uint256 => Property) public properties;
    mapping(uint256 => mapping(address => uint256)) public propertyShares;
    mapping(uint256 => address[]) public propertyShareholders;
    mapping(uint256 => Review[]) public propertyReviews;
    mapping(uint256 => mapping(address => bool)) public hasReviewed;
    mapping(address => bool) public registeredUsers;

    uint256 public propertyCount;

    event PropertyListed(uint256 indexed propertyId, string name, string location, uint256 totalValue);
    event SharesPurchased(uint256 indexed propertyId, address indexed buyer, uint256 shares);
    event ShareholderDividendSent(uint256 indexed propertyId, address indexed shareholder, uint256 amount);
    event ReviewAdded(uint256 indexed propertyId, address indexed reviewer, uint8 rating);

    modifier onlyRegistered() {
        require(registeredUsers[msg.sender], "User not registered");
        _;
    }

    function registerUser() public {
        require(!registeredUsers[msg.sender], "User already registered");
        registeredUsers[msg.sender] = true;
    }

    function isUserRegistered(address user) public view returns (bool) {
        return registeredUsers[user];
    }

    function listProperty(
        string memory _name,
        string memory _location,
        uint256 _totalValue,
        uint256 _totalShares,
        uint256 _pricePerShare
    ) public onlyRegistered {
        require(_totalValue > 0, "Invalid total value");
        require(_totalShares > 0, "Invalid total shares");
        require(_pricePerShare > 0, "Invalid price per share");

        propertyCount++;
        properties[propertyCount] = Property({
            name: _name,
            location: _location,
            totalValue: _totalValue,
            totalShares: _totalShares,
            availableShares: _totalShares,
            pricePerShare: _pricePerShare,
            owner: msg.sender,
            isListed: true
        });

        emit PropertyListed(propertyCount, _name, _location, _totalValue);
    }

    function purchaseShares(uint256 _propertyId, uint256 _shares) public payable onlyRegistered {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");
        Property storage property = properties[_propertyId];
        require(property.isListed, "Property not listed");
        require(_shares > 0 && _shares <= property.availableShares, "Invalid share amount");
        require(msg.value == property.pricePerShare * _shares, "Incorrect payment amount");

        property.availableShares -= _shares;
        propertyShares[_propertyId][msg.sender] += _shares;

        if (propertyShares[_propertyId][msg.sender] == _shares) {
            propertyShareholders[_propertyId].push(msg.sender);
        }

        emit SharesPurchased(_propertyId, msg.sender, _shares);
    }

    function distributeDividends(uint256 _propertyId) public payable onlyRegistered {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");
        Property storage property = properties[_propertyId];
        require(msg.sender == property.owner, "Only owner can distribute dividends");
        require(msg.value > 0, "Must send ETH to distribute");

        uint256 totalShares = property.totalShares - property.availableShares;
        require(totalShares > 0, "No shares have been purchased");

        for (uint256 i = 0; i < propertyShareholders[_propertyId].length; i++) {
            address shareholder = propertyShareholders[_propertyId][i];
            uint256 shares = propertyShares[_propertyId][shareholder];
            if (shares > 0) {
                uint256 dividend = (msg.value * shares) / totalShares;
                payable(shareholder).transfer(dividend);
                emit ShareholderDividendSent(_propertyId, shareholder, dividend);
            }
        }
    }

    function addReview(uint256 _propertyId, uint8 _rating, string memory _comment) public onlyRegistered {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");
        require(_rating >= 1 && _rating <= 5, "Rating must be between 1 and 5");
        require(propertyShares[_propertyId][msg.sender] > 0, "Must own shares to review");
        require(!hasReviewed[_propertyId][msg.sender], "Already reviewed");

        propertyReviews[_propertyId].push(Review({
            reviewer: msg.sender,
            rating: _rating,
            comment: _comment,
            timestamp: block.timestamp
        }));

        hasReviewed[_propertyId][msg.sender] = true;
        emit ReviewAdded(_propertyId, msg.sender, _rating);
    }

    function getPropertyRating(uint256 _propertyId) public view returns (uint256, uint256) {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");

        uint256 totalRating = 0;
        uint256 numReviews = propertyReviews[_propertyId].length;

        for (uint256 i = 0; i < numReviews; i++) {
            totalRating += propertyReviews[_propertyId][i].rating;
        }

        return (totalRating, numReviews);
    }

    function getPropertyReviews(uint256 _propertyId) public view returns (Review[] memory) {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");
        return propertyReviews[_propertyId];
    }

    function getProperty(uint256 _propertyId) public view returns (
        string memory name,
        string memory location,
        uint256 totalValue,
        uint256 totalShares,
        uint256 availableShares,
        uint256 pricePerShare,
        address owner,
        bool isListed
    ) {
        require(_propertyId > 0 && _propertyId <= propertyCount, "Invalid property ID");
        Property storage property = properties[_propertyId];
        return (
            property.name,
            property.location,
            property.totalValue,
            property.totalShares,
            property.availableShares,
            property.pricePerShare,
            property.owner,
            property.isListed
        );
    }

    function getPropertyShares(uint256 _propertyId, address _shareholder) public view returns (uint256) {
        return propertyShares[_propertyId][_shareholder];
    }

    function getPropertyShareholders(uint256 _propertyId) public view returns (address[] memory) {
        return propertyShareholders[_propertyId];
    }
}
